import {
    Menu,
    CalendarDays,
    Layout
  } from "lucide-react";

export default function NavBar() {
    return (
        <div className="bg-gray-200 h-screen w-[50px]">
            <div>
                <button><Menu /></button>
            </div>
            <nav>
                <ul>
                    <li> <CalendarDays /> </li>
                    <li> Stocks</li>
                    <li> Social Media </li>
                </ul>
            </nav>
        </div>
    )
}
